// pages/SignUp.tsx
import React, { useState } from 'react';
import Topbar from '../../components/crm/Topbar';
import styles from '../../styles/crm/auth.module.css';
import { Link, useNavigate } from 'react-router-dom';

const SignUp: React.FC = () => {
  const navigate = useNavigate();

  // State for form inputs
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    password: '',
    organizationData: {
      name: '',
      type: '',
      address: '',
      contact_info: '',
    },
  });
  const [error, setError] = useState<string | null>(null);
  const [isLoading, setIsLoading] = useState(false);

  // Handle input changes for user and organization
  const handleChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = e.target;

    // Check if the input is for organization data
    if (name.startsWith('org_')) {
      const orgKey = name.replace('org_', ''); // Remove prefix
      setFormData(prevFormData => ({
        ...prevFormData,
        organizationData: { ...prevFormData.organizationData, [orgKey]: value },
      }));
    } else {
      setFormData(prevFormData => ({ ...prevFormData, [name]: value }));
    }
  };

  // Handle form submission
  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();

    setIsLoading(true);
    setError(null);

    try {
      const response = await fetch('http://localhost:5007/api/auth/register', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(formData),
      });

      if (!response.ok) {
        const data = await response.json();
        setError(data.message || 'Error occurred during sign-up');
      } else {
        // On successful registration, redirect to the organization details page
        navigate('/crm/requirement-gathering');
      }
    } catch (err) {
      setError('Network error. Please try again.');
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className={styles.authContainer}>
      <Topbar />
      <div className={styles.authContent}>
        <div className={styles.infoSection}>
          <h2>Join Us Today!</h2>
          <p>Sign up to take control of your business and streamline your sales process.</p>
        </div>
        <div className={styles.formSection}>
          <h2>Sign Up</h2>
          <form onSubmit={handleSubmit}>
            <label>Username</label>
            <input
              type="text"
              name="username"
              value={formData.username}
              onChange={handleChange}
              required
            />
            <label>Email</label>
            <input
              type="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
              required
            />
            <label>Password</label>
            <input
              type="password"
              name="password"
              value={formData.password}
              onChange={handleChange}
              required
            />
            <label>Organization Name</label>
            <input
              type="text"
              name="org_name"
              value={formData.organizationData.name}
              onChange={handleChange}
              required
            />
            <label>Organization Type</label>
            <input
              type="text"
              name="org_type"
              value={formData.organizationData.type}
              onChange={handleChange}
              required
            />
            <label>Organization Address</label>
            <input
              type="text"
              name="org_address"
              value={formData.organizationData.address}
              onChange={handleChange}
              required
            />
            <label>Contact Info</label>
            <input
              type="text"
              name="org_contact_info"
              value={formData.organizationData.contact_info}
              onChange={handleChange}
              required
            />
            <button type="submit" disabled={isLoading}>
              {isLoading ? 'Signing Up...' : 'Sign Up'}
            </button>
          </form>
          {error && <p className={styles.error}>{error}</p>}
          <p>Already have an account? <Link to="/crm/signin">Sign In</Link></p>
        </div>
      </div>
    </div>
  );
};

export default SignUp;
